
public class FlowEx20 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int i = 2; i<=9; i++) {
			for(int j=1; j<=1; j++) {
				for(int k=1; k<=9; k++) {
				System.out.printf("[%d * %d = %d]" , i*j , i, i*k);
				}System.out.println();
		}System.out.println();
	}
}
}